from tkinter import *
from base64 import b64decode

def none():
    pass
def Sbutton(root,text,command=none):
    buttonbg=PhotoImage(data=b64decode(''''''))

    return Button(root,
                  text=text,
                  image=buttonbg,
                  compound="center",
                  command=command,
                 
                  foreground="#000000",
                  borderwidth="0",
                  relief="flat",
                  overrelief="groove",
                  cursor="hand2",
                  width="20",
                  height="2",
                  font=("impact", 11))



